def steppingNumber(low: int, high: int):
    queue = list(range(10))
    res = []
    while queue:
        num = queue.pop(0)
        if low < num <= high:
            res.append(num)
        if num == 0 or num > high:
            continue
        lastDigit = num % 10
        if lastDigit > 0:
            nextNum = num * 10 + (lastDigit - 1)
            if nextNum <= high:
                queue.append(nextNum)
        if lastDigit < 9:
            nextNum = num * 10 + (lastDigit + 1)
            if nextNum <= high:
                queue.append(nextNum)
    result_dict = {}
    for i in res:
        list_i = list(map(int, str(i)))
        result_dict[i] = sum(list_i)
    return result_dict

